  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer portrays the boundaries
  of the United States, Puerto Rico, and the U.S. Virgin Islands. The map layer was
  created by extracting county polygon features from the 2006 Census TIGER/Line files
  produced by the U.S. Census Bureau. These files were then merged into a single file
  and the county and State boundaries were dissolved, leaving the national boundary.
  This is a revised version of the July 2012 map layer.\",\n\t\"license_title\": null,\n\t\"extras\":
